Где-то верующий, где-то знающий. Но в основном мечтающий.
Меломан.
Год выпуска: 1992 ;
Пробег: 27 лет;
Высота (см) - 188;
Вес (кг) - 109;
Бортовой компьютер - IQ 152
Фары - тонированные (серо-голубые);
Покраска заводская : русый
Эксплуатация - бережная (возможно использование в сверх экстримальных условиях);
Кузов в прекрасном состоянии;
Тип топлива: Вода, сок, чай, кофе, лимонад, спиртные напитки
Крыша без дефектов, исправна
Тормоза в исправности (Дисковые колодки, РУЧНИК присутствует);
Идеальное состояние, все новое, заводится с пол оборота независимо от состояния. Зимой может эксплуатироваться в экстримальных условиях. ABS, литьё, 4 подушки безопасности при себе 4 комплекта резины, кожанный салон, EURO панель, встроенный GPS навигатор, антикрыло, и освежитель елочка в комплекте :)
Объём двигателя: 1.4 л
Расход топлива 9.8 литров/100 км
